import './index.scss';
import { useNavigate } from 'react-router-dom';
import { PreloaderSeter } from "../../App";

function Logo() {
    const navigate = useNavigate();

    const handleClick = (link) => {
    setPreloader(true);

    setTimeout(() => {
      navigate(link);
    }, 500);
    setTimeout(() => {
      setPreloader(false);
    }, 3000);
    };

    return (
      <button onClick={() => handleClick('/')} className="logo" translate="no">
        <span className="logo__dots">
          <span className="logo__dot"></span>
          <span className="logo__dot"></span>
          <span className="logo__dot"></span>
          <span className="logo__dot"></span>
        </span>
        <span className="logo__text">
          <span>b</span>
          <span>e</span>
          <span>n</span>
          <span>k</span>
          <span>o</span>
        </span>
      </button>
    );
}
  
export default Logo;
